import { apiCall } from "../../utils/apiCall";



// post methods 

export const handleRegister = (e,formData) => (apiCall("/user/register", undefined , e , formData ))

export const handleLogin =  (e,formData) => (apiCall("/user/login", undefined , e , formData )) 

export const forgotpassword =  (e,formData) => (apiCall("/user/forgot/password", undefined, e , formData )) 



